selector_to_html = {"a[href=\"#equation-apriorissh\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-apriorissh\">\n\\[    \\text{sandsynlighed} = \\frac{\\text{antal gunstige udfald}}{\\text{antal mulige udfald}}.\\]</div>", "a[href=\"#a-priori-sandsynlighed\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.4.1. </span>A priori sandsynlighed<a class=\"headerlink\" href=\"#a-priori-sandsynlighed\" title=\"Permalink til denne overskrift\">#</a></h3><p>Sandsynligheder, der kan beregnes uden opstilling af eksperiment, kaldes for <em>a priori sandsynligheder</em> eller <em>teoretiske sandsynligheder</em>. A priori er latin og betyder <em>fra det tidligere</em>, hvilket i denne sammenh\u00e6ng kan forst\u00e5s som en sandsynlighed, der kan bestemmes uafh\u00e6ngigt af erfaring fra et eksperiment. Det er s\u00e5danne sandsynligheder vi ber\u00f8rte i ovenst\u00e5ende afsnit i sp\u00f8rgsm\u00e5lene om terningen og kortspillet. Simple, symmetriske sandsynligheder, som disse, tager udgangspunkt i formlen</p>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.5. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#grundlaeggende-begreber\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1. </span>Grundl\u00e6ggende begreber<a class=\"headerlink\" href=\"#grundlaeggende-begreber\" title=\"Permalink til denne overskrift\">#</a></h1><p>N\u00e5r vi arbejder med sandsynlighedsteori, s\u00e5 bruger vi nogle bestemte termer og begreber, som vi vil introducere i dette kapitel. Vi vil g\u00f8re dette ved at tage udgangspunkt i et <em>stokastisk eksperiment</em>. At et eksperiment er <em>stokastisk</em>, betyder blot, at det, vi f\u00e5r ud p\u00e5 den anden side af eksperimentet, er tilf\u00e6ldigt. Et godt eksempel p\u00e5 et stokastisk eksperiment er et terningekast.</p>", "a[href=\"../Maengdeteori/maengdeoperationer.html#maengdeoperationer\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>M\u00e6ngdeoperationer<a class=\"headerlink\" href=\"#maengdeoperationer\" title=\"Permalink til denne overskrift\">#</a></h1><p>Ligesom vi har regneoperationer for tal, som du jo nu ved kan inddeles i talm\u00e6ngderne), s\u00e5 har vi ogs\u00e5 \u00bbregneoperationer\u00ab for samlinger af tal eller andre elementer, nemlig m\u00e6ngdeoperationer. Vi skal l\u00e6re f\u00f8lgende m\u00e6ngdeoperationer at kende:</p>", "a[href=\"#komplimentaer-haendelse\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.3. </span>Kompliment\u00e6r h\u00e6ndelse<a class=\"headerlink\" href=\"#komplimentaer-haendelse\" title=\"Permalink til denne overskrift\">#</a></h2><p>N\u00e5r vi betragter en h\u00e6ndelse <span class=\"math notranslate nohighlight\">\\(A\\)</span> i udfaldsrummet <span class=\"math notranslate nohighlight\">\\(U\\)</span>, s\u00e5 er der jo udfald tilbage i udfaldsrummet, som vi ikke betragter. Disse vil udg\u00f8re m\u00e6ngden <em>kompliment\u00e6re h\u00e6ndelse</em>. Denne ben\u00e6vnes med <span class=\"math notranslate nohighlight\">\\(A^{\\mathsf{C}}\\)</span>, hvor <span class=\"math notranslate nohighlight\">\\(\\mathsf{C}\\)</span> st\u00e5r for <em>compliment</em>, der er den engelske overs\u00e6ttelse. I andre l\u00e6reb\u00f8ger kan det v\u00e6re, at du vil st\u00f8de p\u00e5 notationen <span class=\"math notranslate nohighlight\">\\(\u2201A\\)</span>, <span class=\"math notranslate nohighlight\">\\(\\overline{A}\\)</span> eller <span class=\"math notranslate nohighlight\">\\(A'\\)</span>. Kompliment\u00e6r m\u00e6ngden kan ogs\u00e5 skrives ved hj\u00e6lp af m\u00e6ngdeoperationer, som vi stiftede bekendtskab med i <a class=\"reference internal\" href=\"../Maengdeteori/maengdeoperationer.html#maengdeoperationer\"><span class=\"std std-numref\">Kapitel 2.3</span></a>:</p>", "a[href=\"#to-sandsynlighedsperspektiver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.4. </span>To sandsynlighedsperspektiver<a class=\"headerlink\" href=\"#to-sandsynlighedsperspektiver\" title=\"Permalink til denne overskrift\">#</a></h2><p>Der findes to prim\u00e6re m\u00e5der at t\u00e6nke om sandsynligheder p\u00e5. Det l\u00e6ner sig lidt op af sp\u00f8rgsm\u00e5let \u00bbhvorn\u00e5r laver vi statistik og hvorn\u00e5r laver vi sandsynlighedsregning?\u00ab. Pr\u00f8v at t\u00e6nk over nedenst\u00e5ende sp\u00f8rgsm\u00e5l:</p>", "a[href=\"#frekventiel-sandsynlighed\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.4.2. </span>Frekventiel sandsynlighed<a class=\"headerlink\" href=\"#frekventiel-sandsynlighed\" title=\"Permalink til denne overskrift\">#</a></h3><p>Sandsynligheder, hvor vi tager udgangspunkt i gunstige udfald fra et eksperiment, kaldes for <em>frekventiel sandsynligheder</em> eller <em>eksperimentiel sandsynligheder</em>. Disse er bestemt med formlen</p>", "a[href=\"../Maengdeteori/maengdeteori.html#maengdeteori-i\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>M\u00e6ngdeteori I<a class=\"headerlink\" href=\"#maengdeteori-i\" title=\"Permalink til denne overskrift\">#</a></h1><p>N\u00e5r vi i daglig tale snakker om m\u00e6ngder, s\u00e5 forst\u00e5r vi, at vi snakker om en samling af ting, personer, m.m.</p><p>For eksempel havde du sikkert forskelligt slags leget\u00f8j, da du var mindre. M\u00e5ske havde du LEGO, Playmobil, Pok\u00e9mon og Schleich. Samler vi disse, s\u00e5 ville de passe godt under \u00bbm\u00e6ngden af leget\u00f8j\u00ab.</p>", "a[href=\"#haendelse\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.2. </span>H\u00e6ndelse<a class=\"headerlink\" href=\"#haendelse\" title=\"Permalink til denne overskrift\">#</a></h2><p>Betragter vi flere udfald i udfaldsrummet samtidigt, kigger vi p\u00e5 en s\u00e5kaldt <em>h\u00e6ndelse</em>. Et eksempel p\u00e5 en h\u00e6ndelse ved kast med en terning kunne v\u00e6re m\u00e6ngden af udfald, der viser ulige tal. Disse udfald betegnes som h\u00e6ndelsens <em>gunstige udfald</em>. Her er der ikke l\u00e6ngere tale om et enkelt udfald, men om flere udfald, der samlet udg\u00f8r en h\u00e6ndelse. Denne h\u00e6ndelse vil v\u00e6re en delm\u00e6ngde af hele terningens udfaldsrum. Vi kan ben\u00e6vne h\u00e6ndelsen med</p>", "a[href=\"#udfald-og-udfaldsrum\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1.1. </span>Udfald og udfaldsrum<a class=\"headerlink\" href=\"#udfald-og-udfaldsrum\" title=\"Permalink til denne overskrift\">#</a></h2><p>Kaster vi en almindelig seks-sidet terning, s\u00e5 ved vi p\u00e5 forh\u00e5nd godt, hvad vi potentielt kan ende ud med at f\u00e5, n\u00e5r terningen er sl\u00e5et. Det, som terningen vil vise, kalder vi for eksperimentets <em>udfald</em>. En seks-sidet terning har udfaldene <span class=\"math notranslate nohighlight\">\\(\\{\\text{1'er},\\text{2'er},\\text{3'er},\\text{4'er},\\text{5'er},\\text{6'er}\\}\\)</span>, og dette kalder vi for terningens <em>udfaldsrum</em>. Denne ben\u00e6vner vi oftest med <span class=\"math notranslate nohighlight\">\\(U\\)</span>:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
